VALUES
	(1,'<p>Thank you for registering for the Ultimate Tennis Ladder  Raleigh.</p><p>Please email <a href=\"mailto:Kenneth.Glanville@raleighnc.gov\" rel=\"noopener noreferrer\" target=\"_blank\">Ken Glanville</a> or contact the Millbrook Exchange Tennis Center at (919) 996-4129 to be added to a specific level.</p>','2022-02-14 16:08:35','2024-06-06 09:11:53','Kenneth.Glanville@raleighnc.gov','Kenneth.Glanville@raleighnc.gov','info@tennis-ladder.com; ivirsen@gmail.com','<p>The Top 8 players who signed up for the tournament are playing.</p><h3>Draw</h3><p>The Final Tournament brackets will automatically generate at midnight on Sunday, $sunday0.</p><h3>Seeding</h3><p>Tournament seeding will operate according to the following parameters:</p><ul><li>The first and second seeds can only play in the Final.</li><li>The Top 4 seeds cannot meet before the Semifinals.</li><li>All players are randomly distributed.</li></ul><h3>Time</h3><p><strong>Quarterfinalists</strong> will play on $friday1.<strong><br>Semifinalists</strong> will play on $saturday1.<br><strong>Finalists</strong> will play on $sunday1.</p>','<p>The Top 8 players who signed up for the tournament are playing.</p><h3>Seeding</h3><p>The players are seeded according to these rules:</p><ul><li>The first and second seeds are placed into opposite brackets.</li><li>Then, the third and fourth seeds are assigned randomly to opposite brackets.</li><li>The remaining players are distributed randomly into open slots.</li></ul><h3>Time</h3><p>The tournament will occur on the second weekend after the regular season.</p><p><strong>Semifinalists</strong> will play on $saturday2.<br><strong>Finalists</strong> will play on $sunday2.</p><p>Each match will have three Doubles rounds, where four players will rotate teams in a Round Robin format. Each team will play 8 games (24 total), and the two players with the most games won will move forward to the next day.</p><p>The ladder winner is the player who wins the most games in the final match.</p>','<p>The Top 16 players who signed up for the tournament are playing.</p><h3>Draw</h3><p>The Final Tournament brackets will automatically generate at midnight on Sunday, $sunday0.</p><h3>Seeding</h3><p>Tournament seeding will operate according to the following parameters:</p><ul><li>The first and second seeds can only play in the Final.</li><li>The Top 4 seeds cannot meet before the Semifinals.</li><li>The Top 8 seeds cannot meet before the Quarterfinals.</li><li>All players are randomly distributed.</li></ul><h3>Time</h3><p><strong>Round of 16 participants</strong> will play between Monday, $monday1, and Sunday, $sunday1.<br><strong>Quarterfinalists</strong> will play between Monday, $monday2, and Friday, $friday2.<br><strong>Semifinalists</strong> will play on $saturday2.<br><strong>Finalists</strong> will play on $sunday2.</p>','{\"citiesNearby\":[{\"name\":\"Cary\",\"slug\":\"cary\",\"state\":\"NC\",\"distance\":0.3424999999999952},{\"name\":\"Durham\",\"slug\":\"durham\",\"state\":\"NC\",\"distance\":1.102499999999994},{\"name\":\"Winston-Salem\",\"slug\":\"winston-salem\",\"state\":\"NC\",\"distance\":9.962499999999947},{\"name\":\"Charlotte\",\"slug\":\"charlotte\",\"state\":\"NC\",\"distance\":25.21250000000003},{\"name\":\"Atlanta\",\"slug\":\"atlanta\",\"state\":\"GA\",\"distance\":209.1124999999999}]}','{\"days\":[{\"datetime\":\"2023-04-16\",\"condition\":\"MostlyCloudy\",\"precip\":0.08267716535433071,\"sunrisePercent\":28,\"sunsetPercent\":17},{\"datetime\":\"2023-04-17\",\"condition\":\"Clear\",\"precip\":0.027559055118110236,\"sunrisePercent\":28,\"sunsetPercent\":17},{\"datetime\":\"2023-04-18\",\"condition\":\"Clear\",\"precip\":0,\"sunrisePercent\":28,\"sunsetPercent\":17},{\"datetime\":\"2023-04-19\",\"condition\":\"Clear\",\"precip\":0,\"sunrisePercent\":28,\"sunsetPercent\":17},{\"datetime\":\"2023-04-20\",\"condition\":\"MostlyCloudy\",\"precip\":0,\"sunrisePercent\":27,\"sunsetPercent\":17},{\"datetime\":\"2023-04-21\",\"condition\":